import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="container mx-auto p-4">
      <h1 className="text-3xl font-bold">Welcome to StreamFlix</h1>
      <p className="mt-2">Browse and subscribe to our platform.</p>
      <Link to="/subscribe" className="mt-4 inline-block bg-red-600 text-white px-4 py-2 rounded">Subscribe Now</Link>
    </div>
  );
};

export default Home;
